import React from 'react';
import './taffList.css';

const StaffList = (props) => {
  const staffs = props.staff;
  return (
    <div>
      <div className="outerBox">
        {staffs.map((staff, index) => (
          <div key={index} className="staffName">
            {staff}
          </div>
        ))}
      </div>
    </div>
  );
};

export default StaffList;
